content:
The Data Mapper Post Action calls a Data Mapper Load (post) to write data to Salesforce. It creates or updates sObjects and produces JSON output, which can be viewed in the Debug log on the Preview tab.

For example:
{
  "Contact_1": [{
    "Id": "0036A000002PeaAQAS",
    "LastName": "Smith",
    "UpsertSuccess": true
  }],
  "Attachment_2": [{
    "Id": "00P6A000000EJ3RUAW",
    "Name": "angular-route.min.js",
    "ParentId": "0036A000002PeaAQAS",
    "UpsertSuccess": true
  }]
}

Merge fields can be used to reference the Id of sObjects, such as %CreateContact:Contact_1:Id%.
